tweet:
@johnmarkcomer your ending to the night on the Trinity reminded me of Gregory Nazianzus and this quote: 

When I think of any One of the Three I think of Him as the Whole, and my eyes are filled, and the greater part of what I am thinking of escapes me.

Thank you

O Church of Christ upon that day,
 When all are gathered in,

When every tear is wiped away
 With every trace of sin; 
Where justice, truth and beauty shine, And death has passed away; 
Where God and man will dwell as one, For all eternity!

